import React from "react";


function RandomCat(props) {

  return (
    <li>
      <a href="http://placekitten.com"> {props.name}</a>
      <img src={`http://placekitten.com/${props.width}/${props.height}`} alt="Random cat"/>
    </li>
  );

}

export default RandomCat;
